(7, 2, '¿Cómo Ayudar?', 'ADISAP te invita pertenecer a una ONG de cooperación para el desarrollo que actúa allí donde más nos necesitan. ', 'Con el objetivo de reforzar nuestros proyectos, ADISAP te invita pertenecer a una ONG de cooperación para el desarrollo que actúa allí donde más nos necesitan. Nuestra prioridad principal es la erradicación de la extrema pobreza, en especial el derecho a mejorar la capacidad productiva y las condiciones de vida de la población de extrema pobreza en la Amazonía Peruana. Juntamos experiencia y esfuerzos con el objetivo de continuar impulsando nuestros proyectos actuales y emprender nuevos retos.<br><br>\n\nTu ayuda es importante. Cualquier momento es bueno para unirte a ADISAP. Porque con tu aportación podemos hacer mucho. Ahora, que has llegado hasta aquí, puedes colaborar con nosotros con tu tiempo o con tu dinero. Lo que vayamos a hacer en el futuro depende de tu ayuda.<br><br>\n\nGracias a tu colaboración, conseguiremos que nuestras actuaciones beneficien a más personas y que el derecho universal de mejorar una calidad de vida sea cada vez más una realidad.<br><br>	\n\n¡Gracias por tu apoyo!', 1, 3, 0, '1425345853-variadas 114.jpg', '0000-00-00', '/adisap/home/admin/images/pub/1425345853-variadas 114.jpg', 'como-ayudar', 0, 1, '2015-03-03 01:24:13', '0000-00-00 00:00:00'),
(15, 2, 'Nosotros', 'dsfsdg dfhdf', '\n\n\n\n\n<p><img style=\"float: left; margin: 0px;\" src=\"/admin/tiny_mce/plugins/openmanager/uploads/images/nosotros.jpg\" alt=\"\" width=\"300\" height=\"300\" /></p>\n<p style=\"text-align: justify;\"><strong style=\"text-align: start;\">NUESTRA EMPRESA</strong></p>\n<p style=\"text-align: justify;\">Somos una empresa dedica a la importaci&oacute;n y distribuci&oacute;n de equipos para maniobras e izajes, tales como tecles,trolley,winches manuales y el&eacute;ctricos, escaleras, tirfor, poleas, cable de acero, accesorio de izajes, &nbsp;eslingas, faja rachet, arneses y l&iacute;neas de vida, etc.</p>\n<p style=\"text-align: justify;\">Escaleras y Maniobras SAC trabaja con marcas reconocidas y certificadas como: FORCE, &nbsp; &nbsp; &nbsp; BULL AMERICAN, TXK, YALE, VITAL, KITO, TRACTEL, SLR, CROSBY,YOKE, HARU, KENEDYNE, HAUK, entre otrasmarcas reconocidas a nivel nacional y mundial.</p>\n<p style=\"text-align: justify;\">Contamos con la experiencia, el personal capacitado, &nbsp;las mejores herramientas para garantizar un servicio profesional y buscando siempre ofrecerles la mejor soluci&oacute;n al menor tiempo posible y mejor costo.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n\n', 0, 0, NULL, '1463415191-fondo-interno.jpg', '0000-00-00', 'images/pub/1463415191-fondo-interno.jpg', 'nosotros', 1, 1, '2016-05-16 16:13:11', '2017-04-24 10:48:32'),
(16, 1, 'sdjkfkjsdfsdf', '', 'sdfdsfds', 0, 0, NULL, '1463416210-fondo-interno.jpg', '0000-00-00', '/manioperu.com/admin/images/pub/1463416210-fondo-interno.jpg', 'sdjkfkjsdfsdf', 1, 1, '2016-05-16 16:30:10', '0000-00-00 00:00:00'),
(17, 2, 'test 100', 'sdfsdf', 'sdgsd gdfgdf', 0, 0, NULL, '1463764943-c8.png', '2016-05-27', '/manioperu.com/admin/images/pub/1463764943-c8.png', 'test-100', 1, 1, '2016-05-20 17:22:23', '0000-00-00 00:00:00'),
(18, 2, 'Alquiler de Equipos', 'test test test test test', '\n\n\n\n\n<p>- Repuestos y Acesoramiento Tecnico permanente.</p>\n<p>- Amplio Stock de Equipos.</p>\n<p>- Montaje e Instalacion, Equipos de sustitucionm inmediata para no perder la produccion.&nbsp;</p>\n<p>- Calidad en el servicio postventa.</p>\n<p>- Especialistas en alquiler de equipos de izaje, manuales y el&eacute;ctricos.</p>\n<p>- Prestamos servicios de alquiler por dia, semanas, meses de acuerdo a su requerimiento.</p>\n<p>- Asesoramiento para comparar si le conviene comprar o alquilar.</p>\n<p>&nbsp;</p>\n<p><strong>CONTACTO:</strong></p>\n<p>KEVIN CAMPOS MAYTA</p>\n<p>Cel.: 981018308</p>\n<p>E-mail: ventas@manioperu.com</p>\n\n', 0, 0, NULL, '1464010881-c7.png', '0000-00-00', '/manioperu.com/admin/images/pub/1464010881-c7.png', 'alquiler-de-equipos', 1, 1, '2016-05-23 13:41:21', '2016-09-19 11:33:39'),
