(22, 2, 'Contactenos', 'fdsfsdf sdf', '\n\n\n\n\n<p><img style=\"float: left;\" src=\"/manioperu.com/admin/tiny_mce/plugins/openmanager/uploads/images/pic2.jpg\" alt=\"\" width=\"77\" height=\"100\" />fdkjjkf sdfjkds fds asdjkasd ajksdjkasd ajksdjkas djkasdkjas djkasd asdsd ajksdjka sdjkasd asjkdasd asjkdjasd asjkdjkasd asdasd asdasasdasdhasd asdasd asdasdasd asdasd</p>\n\n', 0, 0, NULL, '', '2016-06-23', NULL, 'contactenos', 1, 1, '2016-05-25 18:08:50', '2016-08-24 09:06:43'),
(23, 2, 'Dpto. Tecnico', 'asdsd asdasd nasd', '\n\n\n\n\n<p>El mantenimiento preventivo en ESCALERAS Y MANIOBRAS&nbsp;SAC constituye una acci&oacute;n, o serie de acciones necesarias, para alargar la vida &uacute;til del equipo e instalaciones y prevenir la suspensi&oacute;n de las actividades laborales por imprevistos. Tiene como prop&oacute;sito planificar periodos de paralizaci&oacute;n de trabajo en momentos espec&iacute;ficos, para inspeccionar y realizar las acciones de mantenimiento del equipo, con lo que se evitan reparaciones de emergencia.</p>\n<p>El objetivo del <strong>mantenimiento preventivo</strong> es prever los problemas que pueda tener una m&aacute;quina, corregirlos en el momento oportuno y mantener la maquinaria en el punto &oacute;ptimo de funcionamiento y eficiencia.</p>\n<p><strong>&iquest;Cu&aacute;les son las ventajas de un buen mantenimiento preventivo?</strong></p>\n<p>Con un buen mantenimiento preventivo de los productos, se llega a conocer mejor el estado del producto, sus condiciones de trabajo y sus puntos d&eacute;biles para determinar el origen de aver&iacute;as. Con esta inteligencia, se consigue:</p>\n\n', 0, 0, NULL, '', '2016-06-30', NULL, 'dptotecnico', 1, 1, '2016-05-26 13:34:35', '2017-04-21 16:13:39'),
(24, 2, 'Certificaciones', 'test rtertert', '\n\n\n\n\n<p>ManioPer</p>\n\n', 0, 0, NULL, '', '0000-00-00', NULL, 'certificaciones', 1, 1, '2016-08-23 17:22:31', '2016-08-24 08:57:20'),
