INSERT INTO `wsoft_productos` (`id`, `codigo`, `id_categoria`, `id_subcategoria`, `nombre`, `descripcion`, `url`, `fichero`, `stock`, `stock_min`, `precio`, `orden`, `nuevo`, `destacado`, `url_imagen`, `estado`, `id_unidad`, `id_marca`, `fech_reg`, `fech_act`) VALUES
(1, '1089772', 3, 10, 'ISCHIA TEJIDO DE SARGA NEGRO', '<p>Pantalon o Polipasto electrico de cadena con gancho para suspension, 2 movimientos subida, bajada &uarr; &darr; / Freno electromagnetico / Contactores marca SCHNEIDER o ATON uso Industrial Pesado / Doble Voltaje: 220/380 - 220/440 (otros voltajes disponibles) / OPCIONAL: Combinable con Trolley Manual de Rozamiento o Engranaje TXK - Control inalambrico (alcance hasta 100)</p>', NULL, 'p1.png', 5, 5, '135.50', 1, 'N', 'S', 'uploads/productos/Pantalones-hombre-gabardina-de-algodón-estampado-Gris-Oscuro-1292.jpg', 1, NULL, 2, '2012-07-31 18:27:13', '2019-11-23 12:13:33'),
(2, '1324', 3, 17, 'CHALECO AZUL CUELLO REDONDO', '<p>Para sujetar y levantar de manera vertical, todo tipo de placas o planchas de metal / Dise&ntilde;o de ojo giratorio para giros de hasta 180&deg; / Conocidos tambien como perro, clamp / Facil instalacion y operacion, no requiere de mucho mantenimiento / Posee un dispositivo de seguridad para bloqueo / Incluye certificado y 1 a&ntilde;o de garantia</p>', NULL, 'p2.png', 5, 5, '99.90', 4, 'N', 'S', 'uploads/productos/chaleco-azul-36672.jpg', 1, NULL, 1, '0000-00-00 00:00:00', '2019-11-26 21:18:16'),
(3, '45767', 3, 10, 'PANTALONES ISCHIA GABARDINA DE ALGODÓN GRIS MEDIO', '<p>Para sujetar y levantar de manera horizontal, todo tipo de placas o planchas de metal / La capacidad de carga se brinda en funcion a un juego de 2 mordazas / Conocidos tambien como perro, clamp / Facil instalacion y operacion, no requiere de mucho mantenimiento / Incluye certificado y 1 a&ntilde;o de garantia</p>', NULL, 'p1.png', 5, 5, '127.00', 5, 'N', 'S', 'uploads/productos/Pantalones-hombre-Sin-pliegues--Chinos-gabardina-de-algodón-liso-Gris-Medio-1216.jpg', 1, NULL, 2, '0000-00-00 00:00:00', '2019-11-22 23:56:16'),
