(6, '1189772', 3, 9, 'CAMISAS HOMBRE OXFORD LISO', '<p>Para trasladar cargas extremadamente pesadas en superficies planas / Conocido tambien como patin de carga, patines, rodillos / Base fija para traslado en lineas rectas / Base giratoria para realizar giros / Uso industrial pesado / Rodillos de nylon prensados / Facil instalacion y operacion, no requiere de mucho mantenimiento / Incluye certificado y 1 a&ntilde;o de garantia</p>', NULL, '', 5, 5, '119.90', 7, 'N', 'S', 'uploads/productos/Camisas-hombre-Oxford-liso-5401.jpg', 1, NULL, 2, '0000-00-00 00:00:00', '2019-11-23 00:18:25'),
