(121, NULL, NULL, 23, 'Winche Manual p/Cargas Pesadas hasta 3000kg (3t) izaje o arrastre', 'Para tensar o levantar cargas en una variedad de aplicaciones, seguro, practico, de facil operacion / Conocido tambien como cabrestante / No incluye cable de acero / El cambio de giro es automatico / Si suelta la manivela, no se soltara la carga / Freno de accion automatica / Incluye certificado y 1 a&ntilde;o de garantia', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 1, NULL, 0, '2016-08-19 17:09:06', '2016-09-16 10:13:20'),
(123, NULL, NULL, 26, 'Polea para Soga hasta 3.2t', 'Pastecas simples (1 via) y doble (2 vias) / Se usan para cambiar la direccion de la linea de carga y tambien para multiplicar la fuerza, dependiendo de la cantidad de poleas que se utilice / Las poleas de 1 via incluyen un gancho giratorio y una apertura lateral con bisagra, para un rapido posicionamiento de la soga / Incluye certificado y 1 a&ntilde;o de garantia', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 1, NULL, 0, '2016-08-22 13:40:18', '2016-09-09 10:04:33'),
(124, NULL, NULL, 26, 'Polea de Aluminio para Tendido de Conductores Electricos', 'Poleas o roldanas de aluminio para tendido de redes electricas / Se usan para tender los cables en alturas y tambien en el suelo / Incluye un gancho giratorio y una apertura lateral, para un rapido posicionamiento del cable / Proteccion vulcanizada para proteger el cable conductor y sin vulcanizar cuando no es necesario protegerlo / Incluye certificado y 1 a&ntilde;o de garantia', NULL, '', 5, 5, NULL, 3, 'N', 'N', '', 1, NULL, 0, '2016-08-22 13:42:06', '2016-09-09 10:03:45'),
(128, NULL, NULL, 47, 'Linea de Vida de Cabo XC1P', 'Linea de vida de cabo sin amortiguador / 1 gancho peque&ntilde;o de 3/4&quot; + 1 gancho peque&ntilde;o de 3/4&quot; / Capacidad de ruptura de ganchos: 5,000Lbs / Con cabo de nylon de 5/8&rdquo; resistencia a la ruptura: 5000Lbs / Conocido tambien como estrobo de posicionamiento / Longitud: 1.80mts / Incluye certificado y 1 a&ntilde;o de garantia', NULL, '', 5, 5, NULL, 1, 'N', 'N', '', 1, NULL, 0, '2016-08-22 13:58:09', '2016-09-12 10:14:48'),
(130, NULL, NULL, 77, 'Gata Mecanica de Cremallera hasta 20t -', 'Para elevacion de cargas pesadas / Conocido tambien como gata de u&ntilde;a o gata tipo cremallera / Solo debe mover la manivela para elevar su carga, si suelta la manivela, la gata no soltara la carga / Uso industrial pesado / Facil instalacion y operacion, no requiere de mucho mantenimiento / Incluye certificado y 1 a&ntilde;o de garantia', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 1, NULL, 0, '2016-08-22 14:24:19', '2017-04-16 10:46:21'),
(139, NULL, NULL, 31, 'Cable de Acero tipo Boa Alma de Acero 6x19', 'Alma de Acero Construccion 6x19S+IWRC / Alambres negros, segun norma ISO2232 / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran resistencia al roce, abrasion y compresion, baja elongacion / Usos en donde se necesite mas fuerza de traccion como puente colgantes, estrobos, etc / Diametro minimo de polea o tambor: 34 veces el diametro del cable / Incluye certificado', NULL, '', 5, 5, NULL, 1, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:47:43', '2016-09-09 11:39:35'),
(140, NULL, NULL, 31, 'Cable de Acero Galvanizado Alma de Acero 6x19', 'Alma de Acero Construccion 6x19S+IWRC / Alambres galvanizados, segun norma ISO2232  / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran resistencia al roce, abrasion y compresion, baja elongacion / Usos en donde se necesite mas fuerza de traccion como puente colgantes, estrobos, etc / Diametro minimo de polea o tambor: 34 veces el diametro del cable / Incluye certificado', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:48:48', '2016-09-09 11:40:22'),
(141, NULL, NULL, 31, 'Cable de Acero tipo Cobra Alma de Fibra 6x19', 'Alma de Acero Construccion 6x19S+FC / Alambres negros, segun norma ISO2232 / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran resistencia al roce, abrasion y al mismo tiempo flexibles y de uso muy versatil / Uso general, montacargas, winches, polipastos, cable de izaje / Diametro minimo de polea o tambor: 30 veces el diametro del cable/ Incluye certificado', NULL, '', 5, 5, NULL, 3, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:50:16', '2016-09-09 11:41:09'),
(142, NULL, NULL, 31, 'Cable de Acero tipo Cascabel Alma de Acero 6x36 - 6x37', 'Alma de acero Construcciones 6x36 - 6x37 / Alambres negros, segun norma ISO2232 / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran flexibilidad y de uso muy versatil / Uso general, cable principal en puente colgante, estrobos, montacargas, winches, polipastos, cable de izaje / Diametro minimo de polea o tambor: 23 veces el diametro del cable / Incluye certificado', NULL, '', 5, 5, NULL, 4, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:51:48', '2016-09-09 11:41:38'),
(143, NULL, NULL, 31, 'Cable de Acero tipo Superflex Alma de Fibra 6x36 - 6x37', 'Alma de fibra Construcciones 6x36 - 6x37 / Alambres negros, segun norma ISO2232 / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran flexibilidad y de uso muy versatil / Uso general, montacargas, winches, polipastos, cable de izaje, pique de mina / Diametro minimo de polea o tambor: 23 veces el diametro del cable / Incluye certificado', NULL, '', 5, 5, NULL, 5, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:52:45', '2016-09-09 11:42:06'),
(144, NULL, NULL, 31, 'Cable de Acero tipo Ascensor Alma de Fibra 8x19', 'alma de fibra Construccion 8Xs(19)+FC / Alambres negros, segun norma ISO2232 / Factor de seguridad 5:1, su carga de ruptura es 5 veces la carga de trabajo / Gran flexibilidad, ideal para ascensores o elevadores / Usos en montacargas, winches, ascensores de personas y de carga / Diametro minimo de polea o tambor: 23 veces el diametro del cable / Incluye certificado', NULL, '', 5, 5, NULL, 6, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:53:50', '2016-09-09 11:42:41'),
(145, NULL, NULL, 32, 'Cadena de Acero Negro hasta 1\" G80', 'Para izaje o sujecion de cargas extremadamente pesadas, alta resistencia a la traccion / Cadenas de aleacion de acero tratado termicamente grado G80 / De acuerdo a la norma EN818 e ISO/ Acabado negro / Factor de seguridad 4:1, su carga de ruptura es 4 veces la carga de trabajo / Usos en general, izaje de cargas, estrobos y pulpos de cadena, sujecion o ajuste de cargas / Incluye certificado', NULL, '', 5, 5, NULL, 1, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:55:31', '2016-09-09 11:54:31'),
(146, NULL, NULL, 32, 'Cadena de Acero Galvanizado hasta 1\" G30', 'Para uso en el mar; resistencia normal a la traccion, menor a la cadena G80 / Cadenas de aleacion de acero tratado termicamente grado G30 / De acuerdo a la norma EN818 e ISO/ Acabado galvanizado en caliente, para mayor resistencia a la corrosion / Factor de seguridad 4:1, su carga de ruptura es 4 veces la carga de trabajo / Usos en general, trabajos en el mar o cerca a la humedad / Incluye certificado', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 1, NULL, 0, '2016-08-22 16:58:38', '2016-09-09 11:55:06'),
