(150, NULL, NULL, 33, 'Eslingas de Poliester para Izaje de Carga', 'Para sujetar cargas y unirlo con el equipo de izaje, es un complemento muy versatil en las maniobras de carga / Material polyester flexible y resistente, con extremos en forma de ojales / Especialmente dise&ntilde;adas para no maltratar la carga al momento de maniobrar / Factor de seguridad 7:1, su carga de ruptura es 7 veces la carga de trabajo / Norma europea EN1492-1 y AMSE-B30 / Incluye certificado', NULL, '', 5, 5, NULL, 1, 'N', 'N', '', 1, NULL, 0, '2016-08-22 17:11:34', '2016-09-09 12:21:42'),
(151, NULL, NULL, 33, 'Estrobos de Faja o Eslingas con Accesorios de Izaje G80', 'Multiples combinaciones en los extremos con accesorios de izaje G80 marca SLR, ganchos, anillas, etc / Para sujetar cargas y unirlo con el equipo de izaje, es un complemento muy versatil en las maniobras de carga / No maltratan la carga al momento de maniobrar / Factor de seguridad 4:1, su carga de ruptura es 4 veces la carga de trabajo / Norma europea EN1492-1 y AMSE-B30 / Incluye certificado', NULL, '', 5, 5, NULL, 2, 'N', 'N', '', 0, NULL, 0, '2016-08-22 17:14:57', '2017-04-19 17:05:57'),
