CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getBreadcrumbs` (IN `p_opc` TEXT, IN `p_url` TEXT)  NO SQL
BEGIN
IF(p_opc='subcategoria') then
	SELECT c.titulo, c.url
	from wsoft_categorias as c
	 where c.url=p_url;
 ELSE IF(p_opc='categoria') then
	SELECT c.titulo,c.url
	FROM wsoft_categorias as c
	WHERE c.url=p_url;
ELSE
	SELECT 
		p.nombre as producto,
 		c.titulo as titulo_categoria
	FROM wsoft_productos as p
     inner join wsoft_categorias as c on c.id=p.id_categoria
WHERE p.id=p_url;
 end if;	
 end if;
END$$

