CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getProductos` (IN `p_urlcat` TEXT)  NO SQL
SELECT p.id as producto_id, p.id_categoria, p.nombre,p.descripcion, p.url_imagen
FROM wsoft_categorias as c 
 INNER JOIN wsoft_productos as p on p.id_categoria = c.id
 LEFT JOIN wsoft_productos_images as i on i.id_producto=p.id
WHERE c.url= p_urlcat
;$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getProductosByCategoria` (IN `p_idcat` INT, IN `p_perpage` INT, IN `p_start` INT)  NO SQL
SELECT p.producto_id, p.subcategoria_id, p.nombre,p.descripcion, p.fichero as url_img
FROM wsoft_categorias as c
 INNER JOIN wsoft_subcategorias  as s on s.categoria_id=c.id
 INNER JOIN wsoft_productos      as p on p.subcategoria_id = s.id
WHERE c.id=p_idcat
LIMIT p_start,p_perpage
;$$

